import React from "react";
import HeadColumn from "../HeadColumn";

function HeadRow({param, onchange}) {
    console.log('param', param)
    return(
        <tr>
            {param[0].map(elem => {
                return <HeadColumn value={param[elem]} onchange={onchange}/>
            })}
        </tr>
    )
}

export default HeadRow
